import React from 'react';

const CrownPicker = () => {
  const crowns = [
    {
      name: 'Option 1 - Classic Crown',
      description: 'Pointed peaks with jewel dots',
      path: 'M2.5 19h19l-2-10-4.5 5L12 8l-3 6-4.5-5-2 10zm3-14a1.5 1.5 0 100-3 1.5 1.5 0 000 3zm13 0a1.5 1.5 0 100-3 1.5 1.5 0 000 3zM12 6a1.5 1.5 0 100-3 1.5 1.5 0 000 3z',
    },
    {
      name: 'Option 2 - Royal Crown',
      description: 'Traditional with base band',
      path: 'M12 1l3 6 6-3-2 8h-14l-2-8 6 3 3-6zm-8 14h16v2c0 1.1-.9 2-2 2H6c-1.1 0-2-.9-2-2v-2z',
    },
    {
      name: 'Option 3 - Elegant 5-Point',
      description: 'Clean lines with separate base',
      path: 'M5 16L3 5l5.5 5L12 4l3.5 6L21 5l-2 11H5z M3 18h18v2H3v-2z',
    },
    {
      name: 'Option 4 - Modern Minimal',
      description: 'Simplified geometric design',
      path: 'M12 2L9 9l-7-3 3 12h14l3-12-7 3-3-7zm-6 17h12v2H6v-2z',
    },
    {
      name: 'Option 5 - Bold King Crown',
      description: 'Thick bold style',
      path: 'M2 20h20v-2H2v2zm2-4h16l1-9-5 3-4-6-4 6-5-3 1 9z',
    },
    {
      name: 'Option 6 - Sharp Crown',
      description: 'Angular sharp peaks',
      path: 'M12 3l-2 6-6-2 2 9h12l2-9-6 2-2-6zM4 18h16v3H4v-3z',
    },
    {
      name: 'Option 7 - Simple Crown',
      description: 'Clean minimal peaks',
      path: 'M3 18h18v3H3v-3zM5 17l1-8 4 4 2-5 2 5 4-4 1 8H5z',
    },
    {
      name: 'Option 8 - Regal Crown',
      description: 'Curved elegant style',
      path: 'M12 2C9 2 7 6 7 6L3 4l1 10h16l1-10-4 2s-2-4-5-4zM4 16h16v2a2 2 0 01-2 2H6a2 2 0 01-2-2v-2z',
    },
  ];

  return (
    <div className="min-h-screen pt-24 pb-16">
      <div className="max-w-6xl mx-auto px-4 sm:px-6 lg:px-8">
        <h1 className="text-4xl font-bold text-white text-center mb-4">Crown Icon Picker</h1>
        <p className="text-gray-300 text-center mb-12">Click on a crown to see it in the logo preview</p>

        {/* Crown Grid */}
        <div className="grid grid-cols-2 md:grid-cols-4 gap-6 mb-16">
          {crowns.map((crown, index) => (
            <div
              key={index}
              className="bg-dark-card border border-white/10 rounded-2xl p-6 hover:border-primary/50 transition-all cursor-pointer group"
            >
              {/* Large Preview */}
              <div className="flex justify-center mb-4">
                <svg 
                  className="w-20 h-20 text-white group-hover:text-primary-light transition-colors" 
                  viewBox="0 0 24 24" 
                  fill="currentColor"
                >
                  <path d={crown.path} />
                </svg>
              </div>
              
              {/* Info */}
              <h3 className="text-white font-semibold text-center mb-1">{crown.name}</h3>
              <p className="text-gray-400 text-sm text-center">{crown.description}</p>

              {/* Logo Preview */}
              <div className="mt-4 pt-4 border-t border-white/10">
                <div className="flex items-center justify-center gap-2">
                  <svg 
                    className="w-8 h-8 text-white" 
                    viewBox="0 0 24 24" 
                    fill="currentColor"
                  >
                    <path d={crown.path} />
                  </svg>
                  <span className="text-xl font-bold text-white">SEOKings</span>
                </div>
              </div>
            </div>
          ))}
        </div>

        {/* Size Comparison */}
        <div className="bg-dark-card border border-white/10 rounded-2xl p-8">
          <h2 className="text-2xl font-bold text-white mb-6 text-center">Size Comparison</h2>
          <div className="flex flex-wrap justify-center gap-8">
            {crowns.map((crown, index) => (
              <div key={index} className="text-center">
                <div className="flex items-center gap-2 mb-2">
                  <svg className="w-8 h-8 text-white" viewBox="0 0 24 24" fill="currentColor">
                    <path d={crown.path} />
                  </svg>
                  <span className="text-xl font-bold text-white">SEOKings</span>
                </div>
                <span className="text-xs text-gray-500">Option {index + 1}</span>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default CrownPicker;
